import React from "react";
import Card from "./Card";
import { bs } from "./Bs";

const CardList = () => {
  const cardsArray = bs.map((user, i) => {
    return <Card id={bs[i].id} name={bs[i].name} email={bs[i].email} />;
  });
  return <div>{cardsArray}</div>;
};

export default CardList;
